import React from 'react';
import { connect } from 'react-redux';
import Parking from './Parking';

const App = ({settings, operations, onReset, onPark}) =>
  <div>
      <p>CAR PARK TASK</p>
        <Reset value={settings} verb={onReset} /> 
        <Park value={operations} verb={onPark} /> 
        <Parking settingsValue={settings} operationValue={operations} /> 
  </div>

const Reset = ({value, verb}) =>
  <div>
      <p>RESET COMPONENT</p>
      {
         JSON.stringify(value, null, 2)
      }
  </div>

const Park = ({value, varb}) =>
  <div>
      <p>PARK COMPONENT</p>
      {
         JSON.stringify(value, null, 2)
      }
  </div>

const mapStateToProps = state => ({
  settings: state.settingsState,
  operations: state.operationsState
});

const mapDispatchToProps = dispatch => ({
  onReset: init => dispatch({ type: 'RESET', init}),
  onPark:  park => dispatch({ type: 'PARK', park })
});

export default connect(mapStateToProps, mapDispatchToProps)(App);
